import React, { useState, useEffect } from 'react';
import { 
  Calendar, 
  Activity,
  Search,
  FileSpreadsheet,
  GitMerge,
  Zap,
  RefreshCw,
  Download,
  CheckCircle,
  Clock
} from 'lucide-react';

interface DateProcessingStatus {
  cleaned_count: number;
  processed_count: number;
  pending_count: number;
  date_statistics: {
    total_docs: number;
    docs_with_promulgation: number;
    docs_with_general_date: number;
    docs_with_both_dates: number;
    pre_1947_count: number;
    ordinance_count: number;
  };
}

interface ProgressData {
  processed: number;
  total: number;
  successful: number;
  failed: number;
  current_doc: string;
  promulgation_date: string | null;
  general_date: string | null;
}

const Phase4Dashboard: React.FC = () => {
  const [status, setStatus] = useState<DateProcessingStatus | null>(null);
  const [activeTab, setActiveTab] = useState<string>('parsing');

  // Date Parsing Tab State
  const [parseMetadata, setParseMetadata] = useState({
    sourceField1: 'promulgation_date',
    sourceField2: 'general_date',
    targetField: 'unified_date',
    priority: 'promulgation_first'
  });
  const [isParsing, setIsParsing] = useState(false);
  const [parseProgress, setParseProgress] = useState<ProgressData | null>(null);

  // Missing Dates Tab State
  const [missingDatesConfig, setMissingDatesConfig] = useState({
    batchSize: 100,
    useGptApi: true,
    gptModel: 'gpt-4',
    exportFormat: 'excel'
  });
  const [missingStatutes, setMissingStatutes] = useState<any[]>([]);
  const [processingBatch, setProcessingBatch] = useState<boolean>(false);
  const [batchProgress, setBatchProgress] = useState<ProgressData | null>(null);

  useEffect(() => {
    fetchStatus();
  }, []);

  const fetchStatus = async () => {
    try {
      const headers: any = {};
      const token = localStorage.getItem('access_token') || sessionStorage.getItem('access_token');
      if (token) headers['Authorization'] = `Bearer ${token}`;
      const res = await fetch('/api/v1/phase4/status', { headers });
      const data = await res.json();
      if (data.success) setStatus(data);
    } catch (e) {
      console.error(e);
    }
  };

  // Date Parsing Functions
  const handleStartParsing = async () => {
    try {
      setIsParsing(true);
      const headers: any = { 'Content-Type': 'application/json' };
      const token = localStorage.getItem('access_token') || sessionStorage.getItem('access_token');
      if (token) headers['Authorization'] = `Bearer ${token}`;
      
      const response = await fetch('/api/v1/phase4/start-parsing', {
        method: 'POST',
        headers,
        body: JSON.stringify(parseMetadata)
      });
      
      if (response.ok) {
        // Start listening for progress
        const eventSource = new EventSource('/api/v1/phase4/parsing-progress');
        eventSource.onmessage = (event) => {
          const data = JSON.parse(event.data);
          setParseProgress(data);
          if (data.processed === data.total) {
            setIsParsing(false);
            eventSource.close();
            fetchStatus();
          }
        };
      }
    } catch (error) {
      console.error('Failed to start parsing:', error);
      setIsParsing(false);
    }
  };

  const handlePreviewParsing = async () => {
    try {
      const headers: any = { 'Content-Type': 'application/json' };
      const token = localStorage.getItem('access_token') || sessionStorage.getItem('access_token');
      if (token) headers['Authorization'] = `Bearer ${token}`;
      
      const response = await fetch('/api/v1/phase4/preview-parsing', {
        method: 'POST',
        headers,
        body: JSON.stringify(parseMetadata)
      });
      
      const data = await response.json();
      if (data.success) {
        alert(`Preview: ${data.preview_count} documents would be processed`);
      }
    } catch (error) {
      console.error('Failed to preview parsing:', error);
    }
  };

  // Missing Dates Functions
  const handleFetchMissingDates = async () => {
    try {
      const headers: any = {};
      const token = localStorage.getItem('access_token') || sessionStorage.getItem('access_token');
      if (token) headers['Authorization'] = `Bearer ${token}`;
      
      const response = await fetch('/api/v1/phase4/fetch-missing-dates', { headers });
      const data = await response.json();
      
      if (data.success) {
        setMissingStatutes(data.missing_statutes || []);
      }
    } catch (error) {
      console.error('Failed to fetch missing dates:', error);
    }
  };

  const handleProcessAllBatches = async () => {
    try {
      setProcessingBatch(true);
      const headers: any = { 'Content-Type': 'application/json' };
      const token = localStorage.getItem('access_token') || sessionStorage.getItem('access_token');
      if (token) headers['Authorization'] = `Bearer ${token}`;
      
      const response = await fetch('/api/v1/phase4/process-all-batches', {
        method: 'POST',
        headers,
        body: JSON.stringify(missingDatesConfig)
      });
      
      if (response.ok) {
        // Start listening for progress
        const eventSource = new EventSource('/api/v1/phase4/batch-progress');
        eventSource.onmessage = (event) => {
          const data = JSON.parse(event.data);
          setBatchProgress(data);
          if (data.processed === data.total) {
            setProcessingBatch(false);
            eventSource.close();
            handleFetchMissingDates(); // Refresh the list
          }
        };
      }
    } catch (error) {
      console.error('Failed to process all batches:', error);
      setProcessingBatch(false);
    }
  };

  const handleProcessSingleBatch = async () => {
    try {
      const headers: any = { 'Content-Type': 'application/json' };
      const token = localStorage.getItem('access_token') || sessionStorage.getItem('access_token');
      if (token) headers['Authorization'] = `Bearer ${token}`;
      
      const response = await fetch('/api/v1/phase4/process-single-batch', {
        method: 'POST',
        headers,
        body: JSON.stringify({ ...missingDatesConfig, batch_size: missingDatesConfig.batchSize })
      });
      
      const data = await response.json();
      if (data.success) {
        alert(`Processed batch of ${data.processed_count} statutes`);
        handleFetchMissingDates(); // Refresh the list
      }
    } catch (error) {
      console.error('Failed to process single batch:', error);
    }
  };

  const handleExportMissingDates = async () => {
    try {
      const headers: any = {};
      const token = localStorage.getItem('access_token') || sessionStorage.getItem('access_token');
      if (token) headers['Authorization'] = `Bearer ${token}`;
      
      const response = await fetch('/api/v1/phase4/export-missing-dates', { headers });
      const blob = await response.blob();
      
      const url = window.URL.createObjectURL(blob);
      const a = document.createElement('a');
      a.href = url;
      a.download = `missing_dates_${new Date().toISOString().slice(0,19).replace(/:/g,'-')}.xlsx`;
      document.body.appendChild(a);
      a.click();
      window.URL.revokeObjectURL(url);
      document.body.removeChild(a);
    } catch (error) {
      console.error('Failed to export missing dates:', error);
    }
  };

  // Wait for status before rendering
  if (!status || !status.date_statistics) {
    return (
      <div className="p-6 flex items-center justify-center">
        <div className="text-center">
          <RefreshCw className="h-8 w-8 animate-spin mx-auto text-blue-600" />
          <p className="mt-2 text-gray-600">Loading Phase 4 dashboard...</p>
        </div>
      </div>
    );
  }

  return (
    <div className="p-6 space-y-6">
      <div className="border-b pb-4">
        <h1 className="text-3xl font-bold">Phase 4: Enhanced Date Processing</h1>
        <p className="text-gray-600 mt-2">Parse date fields and process missing dates with AI assistance</p>
      </div>

      {/* Tab Navigation */}
      <div className="border-b border-gray-200">
        <nav className="-mb-px flex space-x-8">
          {[
            { id: 'parsing', name: 'Date Parsing', icon: GitMerge, description: 'Parse two date fields into one' },
            { id: 'missing', name: 'Missing Dates', icon: Search, description: 'Fetch and process missing dates with GPT' }
          ].map(tab => {
            const Icon = tab.icon;
            return (
              <button 
                key={tab.id} 
                onClick={() => setActiveTab(tab.id)} 
                className={`py-3 px-1 border-b-2 font-medium text-sm flex items-center space-x-2 ${
                  activeTab === tab.id 
                    ? 'border-blue-500 text-blue-600' 
                    : 'border-transparent text-gray-500 hover:text-gray-700 hover:border-gray-300'
                }`}
              >
                <Icon className="h-4 w-4" />
                <span>{tab.name}</span>
              </button>
            );
          })}
        </nav>
      </div>

      {/* Tab 1: Date Parsing */}
      {activeTab === 'parsing' && (
        <div className="space-y-6">
          <div className="bg-blue-50 p-4 rounded-lg">
            <h2 className="text-xl font-semibold mb-4 flex items-center">
              <GitMerge className="h-5 w-5 mr-2" />
              Date Field Parsing & Unification
            </h2>
            <p className="text-gray-700 mb-4">
              Parse and merge two date fields into a unified date field with configurable priority and metadata tracking.
            </p>
          </div>

          {/* Configuration Panel */}
          <div className="bg-white p-6 rounded-lg border">
            <h3 className="text-lg font-medium mb-4">Configuration</h3>
            <div className="grid grid-cols-2 gap-4">
              <div>
                <label className="block text-sm font-medium text-gray-700 mb-2">Source Field 1</label>
                <input 
                  type="text" 
                  value={parseMetadata.sourceField1}
                  onChange={(e) => setParseMetadata({...parseMetadata, sourceField1: e.target.value})}
                  className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
                  placeholder="e.g., promulgation_date"
                />
              </div>
              <div>
                <label className="block text-sm font-medium text-gray-700 mb-2">Source Field 2</label>
                <input 
                  type="text" 
                  value={parseMetadata.sourceField2}
                  onChange={(e) => setParseMetadata({...parseMetadata, sourceField2: e.target.value})}
                  className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
                  placeholder="e.g., general_date"
                />
              </div>
              <div>
                <label className="block text-sm font-medium text-gray-700 mb-2">Target Field</label>
                <input 
                  type="text" 
                  value={parseMetadata.targetField}
                  onChange={(e) => setParseMetadata({...parseMetadata, targetField: e.target.value})}
                  className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
                  placeholder="e.g., unified_date"
                />
              </div>
              <div>
                <label className="block text-sm font-medium text-gray-700 mb-2">Priority</label>
                <select 
                  value={parseMetadata.priority}
                  onChange={(e) => setParseMetadata({...parseMetadata, priority: e.target.value})}
                  className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
                >
                  <option value="promulgation_first">Promulgation Date First</option>
                  <option value="general_first">General Date First</option>
                  <option value="most_recent">Most Recent Date</option>
                  <option value="earliest">Earliest Date</option>
                </select>
              </div>
            </div>
            
            <div className="mt-6 flex space-x-3">
              <button 
                onClick={handleStartParsing}
                disabled={isParsing}
                className="bg-blue-600 text-white px-6 py-2 rounded-lg hover:bg-blue-700 transition-colors flex items-center disabled:opacity-50 disabled:cursor-not-allowed"
              >
                {isParsing ? (
                  <>
                    <RefreshCw className="h-4 w-4 mr-2 animate-spin" />
                    Parsing...
                  </>
                ) : (
                  <>
                    <Calendar className="h-4 w-4 mr-2" />
                    Start Date Parsing
                  </>
                )}
              </button>
              <button 
                onClick={handlePreviewParsing}
                disabled={isParsing}
                className="bg-gray-600 text-white px-6 py-2 rounded-lg hover:bg-gray-700 transition-colors disabled:opacity-50 disabled:cursor-not-allowed"
              >
                Preview Results
              </button>
            </div>
          </div>

          {/* Parsing Progress */}
          {isParsing && parseProgress && (
            <div className="bg-white p-6 rounded-lg border">
              <h3 className="text-lg font-medium mb-4">Parsing Progress</h3>
              <div className="w-full bg-gray-200 rounded-full h-2.5 mb-4">
                <div 
                  className="bg-blue-600 h-2.5 rounded-full transition-all duration-300" 
                  style={{width: `${(parseProgress.processed / parseProgress.total) * 100}%`}}
                ></div>
              </div>
              <div className="flex justify-between text-sm text-gray-600">
                <span>Processed: {parseProgress.processed} / {parseProgress.total}</span>
                <span>Success: {parseProgress.successful} | Failed: {parseProgress.failed}</span>
              </div>
              {parseProgress.current_doc && (
                <p className="text-sm text-gray-700 mt-2">Currently processing: {parseProgress.current_doc}</p>
              )}
            </div>
          )}

          {/* Status Panel */}
          <div className="bg-white p-6 rounded-lg border">
            <h3 className="text-lg font-medium mb-4">Current Status</h3>
            <div className="grid grid-cols-3 gap-4">
              <div className="bg-green-50 p-4 rounded-lg">
                <p className="text-sm text-green-600 font-medium">Processed</p>
                <p className="text-2xl font-bold text-green-700">{status.processed_count}</p>
              </div>
              <div className="bg-yellow-50 p-4 rounded-lg">
                <p className="text-sm text-yellow-600 font-medium">Pending</p>
                <p className="text-2xl font-bold text-yellow-700">{status.pending_count}</p>
              </div>
              <div className="bg-blue-50 p-4 rounded-lg">
                <p className="text-sm text-blue-600 font-medium">Total</p>
                <p className="text-2xl font-bold text-blue-700">{status.date_statistics.total_docs}</p>
              </div>
            </div>
          </div>
        </div>
      )}

      {/* Tab 2: Missing Dates */}
      {activeTab === 'missing' && (
        <div className="space-y-6">
          <div className="bg-orange-50 p-4 rounded-lg">
            <h2 className="text-xl font-semibold mb-4 flex items-center">
              <Search className="h-5 w-5 mr-2" />
              Missing Date Processing
            </h2>
            <p className="text-gray-700 mb-4">
              Fetch statutes with missing dates, process in batches using AI, and export results to Excel.
            </p>
          </div>

          {/* Configuration Panel */}
          <div className="bg-white p-6 rounded-lg border">
            <h3 className="text-lg font-medium mb-4">Processing Configuration</h3>
            <div className="grid grid-cols-2 gap-4">
              <div>
                <label className="block text-sm font-medium text-gray-700 mb-2">Batch Size</label>
                <input 
                  type="number" 
                  value={missingDatesConfig.batchSize}
                  onChange={(e) => setMissingDatesConfig({...missingDatesConfig, batchSize: parseInt(e.target.value)})}
                  className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
                  min="1" max="1000"
                />
              </div>
              <div>
                <label className="block text-sm font-medium text-gray-700 mb-2">GPT Model</label>
                <select 
                  value={missingDatesConfig.gptModel}
                  onChange={(e) => setMissingDatesConfig({...missingDatesConfig, gptModel: e.target.value})}
                  className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
                >
                  <option value="gpt-4">GPT-4</option>
                  <option value="gpt-3.5-turbo">GPT-3.5 Turbo</option>
                  <option value="gpt-4-turbo">GPT-4 Turbo</option>
                </select>
              </div>
              <div className="col-span-2">
                <label className="flex items-center space-x-2">
                  <input 
                    type="checkbox" 
                    checked={missingDatesConfig.useGptApi}
                    onChange={(e) => setMissingDatesConfig({...missingDatesConfig, useGptApi: e.target.checked})}
                    className="rounded border-gray-300 text-blue-600 focus:ring-blue-500"
                  />
                  <span className="text-sm font-medium text-gray-700">Use GPT API for Date Extraction</span>
                </label>
              </div>
            </div>
            
            <div className="mt-6 flex flex-wrap gap-3">
              <button 
                onClick={handleFetchMissingDates}
                className="bg-orange-600 text-white px-6 py-2 rounded-lg hover:bg-orange-700 transition-colors flex items-center"
              >
                <Search className="h-4 w-4 mr-2" />
                Fetch Missing Dates
              </button>
              <button 
                onClick={handleProcessAllBatches}
                disabled={missingStatutes.length === 0 || processingBatch}
                className="bg-green-600 text-white px-6 py-2 rounded-lg hover:bg-green-700 transition-colors disabled:opacity-50 disabled:cursor-not-allowed flex items-center"
              >
                {processingBatch ? (
                  <>
                    <RefreshCw className="h-4 w-4 mr-2 animate-spin" />
                    Processing...
                  </>
                ) : (
                  <>
                    <Zap className="h-4 w-4 mr-2" />
                    Process All Batches
                  </>
                )}
              </button>
              <button 
                onClick={handleProcessSingleBatch}
                disabled={missingStatutes.length === 0 || processingBatch}
                className="bg-blue-600 text-white px-6 py-2 rounded-lg hover:bg-blue-700 transition-colors disabled:opacity-50 disabled:cursor-not-allowed"
              >
                Process One Batch
              </button>
              <button 
                onClick={handleExportMissingDates}
                disabled={missingStatutes.length === 0}
                className="bg-gray-600 text-white px-6 py-2 rounded-lg hover:bg-gray-700 transition-colors disabled:opacity-50 disabled:cursor-not-allowed flex items-center"
              >
                <FileSpreadsheet className="h-4 w-4 mr-2" />
                Export to Excel
              </button>
            </div>
          </div>

          {/* Missing Statutes List */}
          {missingStatutes.length > 0 && (
            <div className="bg-white p-6 rounded-lg border">
              <h3 className="text-lg font-medium mb-4">Missing Dates Found: {missingStatutes.length}</h3>
              <div className="max-h-96 overflow-y-auto">
                <table className="min-w-full divide-y divide-gray-200">
                  <thead className="bg-gray-50">
                    <tr>
                      <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Statute Name</th>
                      <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Best Date Found</th>
                      <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Reason</th>
                      <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Status</th>
                    </tr>
                  </thead>
                  <tbody className="bg-white divide-y divide-gray-200">
                    {missingStatutes.slice(0, 10).map((statute, index) => (
                      <tr key={index}>
                        <td className="px-6 py-4 whitespace-nowrap text-sm font-medium text-gray-900">
                          {statute.statute_name || 'N/A'}
                        </td>
                        <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500">
                          {statute.best_date || 'Not found'}
                        </td>
                        <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500">
                          {statute.selection_reason || 'N/A'}
                        </td>
                        <td className="px-6 py-4 whitespace-nowrap">
                          <span className={`px-2 py-1 text-xs font-medium rounded-full ${
                            statute.status === 'processed' ? 'bg-green-100 text-green-800' :
                            statute.status === 'processing' ? 'bg-yellow-100 text-yellow-800' :
                            'bg-gray-100 text-gray-800'
                          }`}>
                            {statute.status || 'pending'}
                          </span>
                        </td>
                      </tr>
                    ))}
                  </tbody>
                </table>
                {missingStatutes.length > 10 && (
                  <p className="text-sm text-gray-500 mt-2">Showing first 10 of {missingStatutes.length} statutes</p>
                )}
              </div>
            </div>
          )}

          {/* Processing Progress */}
          {processingBatch && batchProgress && (
            <div className="bg-white p-6 rounded-lg border">
              <h3 className="text-lg font-medium mb-4">Processing Progress</h3>
              <div className="w-full bg-gray-200 rounded-full h-2.5 mb-4">
                <div 
                  className="bg-blue-600 h-2.5 rounded-full transition-all duration-300" 
                  style={{width: `${(batchProgress.processed / batchProgress.total) * 100}%`}}
                ></div>
              </div>
              <div className="flex justify-between text-sm text-gray-600">
                <span>Processed: {batchProgress.processed} / {batchProgress.total}</span>
                <span>Success: {batchProgress.successful} | Failed: {batchProgress.failed}</span>
              </div>
              {batchProgress.current_doc && (
                <p className="text-sm text-gray-700 mt-2">Currently processing: {batchProgress.current_doc}</p>
              )}
            </div>
          )}
        </div>
      )}
    </div>
  );
};

export default Phase4Dashboard;
